"use client";
import React, { useState, useEffect, ChangeEvent, FormEvent } from "react";
import { jsPDF } from "jspdf";
import { MdContactEmergency, MdFormatListBulletedAdd } from "react-icons/md";
import { BsCalendarDate } from "react-icons/bs";
import { FaUserDoctor } from "react-icons/fa6";
import { GrCertificate } from "react-icons/gr";

interface FormData {
  name: string;
  cid: string;
  startDate: string;
  endDate: string;
  reason: string;
  doctor: string;
  crm: string;
}

const EmissionCertifield: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    name: "",
    cid: "",
    startDate: "",
    endDate: "",
    reason: "",
    doctor: "Iara Padilha Da Silva",
    crm: "5425",
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { id, value } = e.target;
    setFormData({ ...formData, [id]: value });
  };

  /* fuynção para emitir atestados */
  const handleSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    const doc = new jsPDF();

    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    const marginX = 20;
    const marginY = 20;

    const centeredText = (text: string, y: number) => {
      const textWidth = doc.getTextWidth(text);
      const x = (pageWidth - textWidth) / 2;
      doc.text(text, x, y);
    };
    //const imageUrl = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAA...'; // Substitua pelo seu Base64
    const imageUrl =
      "data:image/png;base64,";

    doc.addImage(imageUrl, "PNG", 60, 100, 80, 60); // Substitua pelo seu Base64

    // Cabeçalho
    doc.setFontSize(18);
    doc.setFont("helvetica", "bold");
    centeredText("Atestado Médico", marginY);
    doc.setFontSize(12);
    doc.setFont("helvetica", "normal");

    // Texto do atestado
    const datainicial = formatDate(formData.startDate);
    const datafinal = formatDate(formData.endDate);
    const nameMount = formatDateName(formData.startDate);
    const atestadoText = `Atesto para os devidos fins que o(a) Sr(a) ${
      formData.name
    } necessita de  ${calculateDays(
      formData.startDate,
      formData.endDate
    )} dias de repouso por motivo de doença  
    
    
CID ${formData.cid}    
Serra/ES - ${nameMount}`;

    const splitText = doc.splitTextToSize(
      atestadoText,
      pageWidth - marginX * 2
    );
    doc.text(splitText, marginX, marginY + 20);

    // Assinatura do médico
    doc.setFont("helvetica", "normal");
    doc.text(`Dr(a). ${formData.doctor}`, marginX, pageHeight - marginY - 40);
    doc.text(
      `Medica do Trabalho - CRM ES ${formData.crm}`,
      marginX,
      pageHeight - marginY - 30
    );

    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);
    doc.text(
      `Esse documento só é valido mediante carimbo e/ou assinatura do Medico`,
      marginX,
      pageHeight - marginY - 20
    );
    doc.save("atestado.pdf");
    clearinputs()
  };

  //calcula a quantidade de dias
  const calculateDays = (startDate: string, endDate: string): number => {
    const start = new Date(startDate);
    const end = new Date(endDate);
    const diffTime = Math.abs(end.getTime() - start.getTime());
    const diffDays = Math.ceil(diffTime / (1000 * 60 * 60 * 24));
    return diffDays + 1;
  };

  //converte o formato da data
  const formatDate = (date: string): string => {
    const [year, month, day] = date.split("-");
    return `${day}/${month}/${year}`;
  };

  const formatDateName = (date: string): string => {
    const [year, month, day] = date.split("-");

    // Array com os nomes dos meses
    const months = [
      "janeiro",
      "fevereiro",
      "março",
      "abril",
      "maio",
      "junho",
      "julho",
      "agosto",
      "setembro",
      "outubro",
      "novembro",
      "dezembro",
    ];

    // Convertendo o número do mês para o nome correspondente
    const monthName = months[parseInt(month, 10) - 1];
    return `${day} de ${monthName} de ${year}`;
  };
    


  function clearinputs(){
    setFormData({
      name: "",
      cid: "",
      startDate: "",
      endDate: "",
      reason: "",
      doctor: "Iara Padilha Da Silva",
      crm: "5425",
    })
  }


  return (
    <>
      <div className="grid grid-cols-3 gap-8">
        <div className="col-span-5 xl:col-span-3">
          <div className="rounded-[10px] border border-stroke bg-white shadow-1 dark:border-dark-3 dark:bg-gray-dark dark:shadow-card">
            <div className="border-b border-stroke px-7 py-4 dark:border-dark-3">
              <h3 className="font-medium text-dark dark:text-white">
                PREENCHA OS CAMPOS PARA EMISSÃO DO ATESTADO
              </h3>
            </div>
            <div className="p-7">
              <form onSubmit={handleSubmit}>
                <div className="mb-5.5">
                  <label
                    className="mb-3 block text-body-sm font-medium text-dark dark:text-white"
                    htmlFor="name"
                  >
                    Nome do Paciente
                  </label>
                  <div className="relative">
                    <span className="absolute left-4.5 top-1/2 -translate-y-1/2">
                      <MdContactEmergency size={24} />
                    </span>
                    <input
                      className="w-full rounded-[7px] border-[1.5px] border-stroke bg-white py-2.5 pl-12.5 pr-4.5 text-dark focus:border-primary focus-visible:outline-none dark:border-dark-3 dark:bg-dark-2 dark:text-white dark:focus:border-primary"
                      type="text"
                      id="name"
                      placeholder="Paciente da Silva"
                      value={formData.name}
                      onChange={handleChange}
                    />
                  </div>
                </div>

                <div className="mb-5.5">
                  <label
                    className="mb-3 block text-body-sm font-medium text-dark dark:text-white"
                    htmlFor="cid"
                  >
                    CID
                  </label>
                  <div className="relative">
                    <span className="absolute left-4.5 top-1/2 -translate-y-1/2">
                      <MdFormatListBulletedAdd size={24} />
                    </span>
                    <input
                      className="w-full rounded-[7px] border-[1.5px] border-stroke bg-white py-2.5 pl-12.5 pr-4.5 text-dark focus:border-primary focus-visible:outline-none dark:border-dark-3 dark:bg-dark-2 dark:text-white dark:focus:border-primary"
                      type="text"
                      id="cid"
                      placeholder="CID0000"
                      value={formData.cid}
                      onChange={handleChange}
                    />
                  </div>
                </div>

                {/* data de inicio e fim */}
                <div className=" w-full flex gap-5">
                  <div className="mb-5.5">
                    <label
                      className="mb-3 block text-body-sm font-medium text-dark dark:text-white"
                      htmlFor="startDate"
                    >
                      Data de Início
                    </label>
                    <div className="relative">
                      <span className="absolute left-4.5 top-1/2 -translate-y-1/2">
                        <BsCalendarDate size={24} />
                      </span>
                      <input
                        className="w-full rounded-[7px] border-[1.5px] border-stroke bg-white py-2.5 pl-12.5 pr-4.5 text-dark focus:border-primary focus-visible:outline-none dark:border-dark-3 dark:bg-dark-2 dark:text-white dark:focus:border-primary"
                        type="date"
                        id="startDate"
                        placeholder="00/00/00"
                        value={formData.startDate}
                        onChange={handleChange}
                      />
                    </div>
                  </div>

                  <div className="mb-5.5">
                    <label
                      className="mb-3 block text-body-sm font-medium text-dark dark:text-white"
                      htmlFor="endDate"
                    >
                      Data Fim
                    </label>
                    <div className="relative">
                      <span className="absolute left-4.5 top-1/2 -translate-y-1/2">
                        <BsCalendarDate size={24} />
                      </span>
                      <input
                        className="w-full rounded-[7px] border-[1.5px] border-stroke bg-white py-2.5 pl-12.5 pr-4.5 text-dark focus:border-primary focus-visible:outline-none dark:border-dark-3 dark:bg-dark-2 dark:text-white dark:focus:border-primary"
                        type="date"
                        id="endDate"
                        placeholder="00/00/00"
                        value={formData.endDate}
                        onChange={handleChange}
                      />
                    </div>
                  </div>
                </div>
                {/* fim de data de inicio e fim */}

                <div className="mb-5.5">
                  <label
                    className="mb-3 block text-body-sm font-medium text-dark dark:text-white"
                    htmlFor="doctor"
                  >
                    Nome do Médico(a)
                  </label>
                  <div className="relative">
                    <span className="absolute left-4.5 top-1/2 -translate-y-1/2">
                      <FaUserDoctor size={24} />
                    </span>
                    <input
                      className="w-full rounded-[7px] border-[1.5px] border-stroke bg-white py-2.5 pl-12.5 pr-4.5 text-dark focus:border-primary focus-visible:outline-none dark:border-dark-3 dark:bg-dark-2 dark:text-white dark:focus:border-primary"
                      type="text"
                      id="doctor"
                      placeholder="Dr Yara"
                      value={formData.doctor}
                      onChange={handleChange}
                    />
                  </div>
                </div>

                <div className="mb-5.5">
                  <label
                    className="mb-3 block text-body-sm font-medium text-dark dark:text-white"
                    htmlFor="doctor"
                  >
                    CRM
                  </label>
                  <div className="relative">
                    <span className="absolute left-4.5 top-1/2 -translate-y-1/2">
                      <GrCertificate size={24} />
                    </span>
                    <input
                      className="w-full rounded-[7px] border-[1.5px] border-stroke bg-white py-2.5 pl-12.5 pr-4.5 text-dark focus:border-primary focus-visible:outline-none dark:border-dark-3 dark:bg-dark-2 dark:text-white dark:focus:border-primary"
                      type="text"
                      id="crm"
                      placeholder="0000"
                      value={formData.crm}
                      defaultValue="5425"
                      onChange={handleChange}
                    />
                  </div>
                </div>

                <div className="flex justify-end gap-3">
                  <button
                    className="flex justify-center rounded-[7px] border border-stroke px-6 py-[7px] font-medium text-dark hover:shadow-1 dark:border-dark-3 dark:text-white"
                    type="button"
                  >
                    Cancelar
                  </button>
                  <button
                    className="flex justify-center rounded-[7px] bg-primary px-6 py-[7px] font-medium text-gray-2 hover:bg-opacity-90"
                    type="submit"
                  >
                    Emitir Atestado
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default EmissionCertifield;
